    return (
        <div key='shape' className='w-1/6 mx-auto pt-3'>
            <svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 162 18'><g id='Layer_2' data-name='Layer 2'><g id='Layer_1-2' data-name='Layer 1'><ellipse cx='81' cy='9' rx='81' ry='9'/></g></g></svg>
        </div>
    )
};
